import Link from 'next/link'

export default function Header() {
  return (
    <div>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/projects">
        <a>Projects</a>
      </Link>
      <Link href="/designs">
        <a>Designs</a>
      </Link>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <a>Contact</a>
      <style jsx>{`

        a {
          text-decoration: none;
          color: blue;
          font-family: 'Arial';
          }

        `}</style>
    </div>
  )
}
